const SubTitle = styled.h3 `
  color: white;
`
const AboutMe = styled.div `
  border: 1.25 solid white;
`


function App() {
  return (
    <div className="App">
      <Title>Michael Stevens</Title>
      <SubTitle>Full-stack web developer</SubTitle>

    <div>

    </div>
  </div>
  );
}

export default App;
